    Game features:
    ~~~~~~~~~~~~~~
    Amateur writer Jake Tobin, in search of material for his latest novel,
    has moved to the small, quaint town of Shady Brook with his blind
    father, Wayne.  At first, the town seems very welcoming.  Jake's new
    neighbor, Tim Richardson, seems friendly, and the Ekan family is always
    willing to lend a helping hand.

    But soon, mysterious things start happening in the town.  One of the
    residents commits suicide, and Jake suspects a cover-up.  Could this
    town take part in a conspiracy to cover up a murder?

    As Jake investigates, he gets more than he bargained for:  a town
    secret so terrifying that there is no turning back...


